import React from 'react'

export default function BusinessList({business}) {
  if(business.length === 0){
    return (
      <div className='empty-search'>
        <h3>Unfortunately no business</h3>  
      </div>
    )
  }


  return (
    <div>BusinessList</div>
  )
}
